head.script:
 

	scwin.onpageload = function() {
		scwin.fn_setPivotOpt();
	};
	
	scwin.fn_setPivotOpt = function(){
		var tmpArr,tmpArrLen,i;
		tmpArr = dc_data.getColumnDistinctDataArray("name");
		tmpArr.sort();
		tmpArrLen = tmpArr.length;
		for(i=0;i<tmpArrLen;i++){
			if(tmpArr[i] === "전국"){
				tmpArr.splice(i,1);
				break;
			}
		}
		ui_pivot.setFieldOption( [{ "id":"name", "sortOrder" : "전국,"+tmpArr.join(",")}] );	
	};
